int f1() { return(1); }
int f2(int X) { f3(); if (X==1) return f1(); else return (X*f2(X-1)); }
int f3() { return(5); }
Which one of the following options represents the activation tree corresponding to the main function?

Consider the C function foo and the binary tree shown.
typedef struct node {
  int val;
  struct node *left, *right;
} node;
int foo(node *p) {
  int retval;
  if (p == NULL)
    return 0;
  else {
    retval = p->val + foo(p->left) + foo(p->right);
    printf("%d ", retval);
    return retval;
  }
}
When foo is called with a pointer to the root node of the given binary tree, what will it print?

